import React, { Component } from "react";
import axios from 'axios'
import EventsApi from './Events-api'
import './Events.css'

class Events extends Component {
    componentDidMount() {
        var username = 'cultureclub';
        var password = 'v6rg37dncb36';
        axios
            .get('http://api.eventfinda.com.au/v2/events.xml?point=-37.8136,144.9631&radius=5')
            .then(function (res) {
                console.log(res)
            })

    }

    render() {
        return (
            <div className="events">
                <h2>EVENTS</h2>
            </div>
        );
    }
}

export default Events;
